        </li>
        <li>
          <button onClick={() => scrollToSection(refs.projectsRef)}>{"< Projects />"}</button>
        </li>
        <li>
          <button onClick={() => scrollToSection(refs.skillsRef)}>{"< Skills />"}</button>  {/* âœ… Added Skills */}
        </li>
        <li>
